import React from "react";
import {
  TaskbarContainer,
  Wrapper,
  TasksList,
  ListItem,
  TastContent,
  TastContentItem
} from "./taskbar.styles";
const Taskbar = () => {
  return (
    <TaskbarContainer>
      <Wrapper>
        <TasksList>
          <ListItem>Description</ListItem>
          <ListItem>Information</ListItem>
          <ListItem>Reviews (2)</ListItem>
        </TasksList>
      </Wrapper>
      <TastContent>
        <TastContentItem></TastContentItem>
        <TastContentItem></TastContentItem>
        <TastContentItem></TastContentItem>
      </TastContent>
    </TaskbarContainer>
  );
};

export default Taskbar;
